memberdef.initializer:
= $derived(data.map(d => {
        const xVal = xAccessor(d);
        const yVal = yAccessor(d);


        const xs = xScaleVideo as any;
        const ys = yScaleVideo as any;

        return {
            x: isVertical ? xs(xVal) : 0,
            y: isVertical ? ys(yVal) : ys(xVal),
            width: isVertical ? xs.bandwidth() : xs(yVal),
            height: isVertical ? innerHeight - ys(yVal) : ys.bandwidth(),
            label: xVal,
            value: yVal
        };
    }))

= $derived.by(() => {
        if (isVertical) {
             const domain = (xScaleVideo as any).domain();
             if (resolvedWidth > 0 && resolvedWidth < 600 && domain.length > 0) {
                const barWidth = resolvedWidth / domain.length;
                const minLabelWidth = 30; 
                const step = Math.ceil(minLabelWidth / barWidth);
                if (step > 1) return domain.filter((_: any, i: number) => i % step === 0);
             }
             return domain;
        } else {
            return (xScaleVideo as any).ticks(resolvedWidth / 80);
        }
    })
